import React, { Component, useState } from "react";
import { VictoryLine, VictoryChart } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    this.state = {
        data: [
            {x: 1640908800, y: 177.57},
            {x: 1641168000, y: 182.01},
            {x: 1641254400, y: 179.7},
            {x: 1641340800, y: 174.92},
            {x: 1641427200, y: 172},
            {x: 1641513600, y: 172.17},
            {x: 1641772800, y: 172.19},
            {x: 1641859200, y: 175.08},
            {x: 1641945600, y: 175.53},
            {x: 1642032000, y: 172.19},
            {x: 1642118400, y: 173.07},
            {x: 1642464000, y: 169.8},
            {x: 1642550400, y: 166.23},
            {x: 1642636800, y: 164.51},
            {x: 1642723200, y: 162.41},
            {x: 1642982400, y: 161.62},
            {x: 1643068800, y: 159.78},
            {x: 1643155200, y: 159.69},
            {x: 1643241600, y: 159.22},
            {x: 1643328000, y: 170.33},
        ]
      };
    // console.log(chart)
    }
    componentDidMount() {
        this.setState({data: compHistory("AAPL", 1)})
    }
  render() {
      console.log(this.state.data)
    return (
      <div>
        <h1>Tacos per Day</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
        </VictoryChart>
      </div>
    );
  }
}
